import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar2 from "./Navbar2";
import { Link } from "react-router-dom";
// import { Nav, NavDropdown, Dropdown, DropdownButton, Button } from 'react-bootstrap';

const Employeeform = () => {
    const navigate = useNavigate();
    const [employee, setEmployee] = useState(
        {
            firstName: "",
            lastName: "",
            emailId: "",
            employeeId: "",
            password: "",
            role: ""

        }
    )
    const { firstName, lastName, emailId, employeeId, password, role } = employee
    const onInputChange = (e) => {
        setEmployee({
            ...employee,
            [e.target.name]: e.target.value
        });
    }
    const handleSubmit = async (e) => {
        e.preventDefault();
        await axios.post(`http://localhost:8080/admin/employee/addemployee`, {
            "firstName": firstName,
            "lastName": lastName,
            "emailId": emailId,
            "employeeId": employeeId,
            "password": password,
            "role": role,
        }
        )
            .then(res => {
                console.log(res.data)
                if (res.status === 404) {
                    alert(res.data)
                }
            })
            .catch(error => {
                console.log(error)
            })
        navigate("/Addemployee");

    };
    return (
        <div>
            <Navbar2></Navbar2>
            <div className="container">
                <div className="row">
                    <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                        <h2 className="text-center m-4"> Register Employee  </h2>
                        <form className="form" onSubmit={(e) => handleSubmit(e)}>
                            <div className="mb-3">

                                <div class="row">
                                    <div class="col">
                                    <label htmlFor="FirstName" className="form-label">FirstName</label>
                                    <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your employee firstname"
                                    name="firstName"
                                    value={firstName}
                                    onChange={onInputChange}
                                ></input>
                                    </div>
                                    <div class="col">
                                    <label htmlFor="LastName" className="form-label">LastName</label>
                                    <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your employeelastname"
                                    name="lastName"
                                    value={lastName}
                                    onChange={onInputChange}
                                ></input>
                                    </div>
                                </div>
                               </div>
                            <div className="mb-3">
                                <label htmlFor="EmailId" className="form-label">EmailId</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your emailid"
                                    name="emailId"
                                    value={emailId}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="employeeId" className="form-label">EmployeeId</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your EmployeeId"
                                    name="employeeId"
                                    value={employeeId}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="password" className="form-label">Password</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your password"
                                    name="password"
                                    value={password}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="role" className="form-label">Role</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your role"
                                    name="role"
                                    value={role}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            {/* <div className="mb-3">
                        <label htmlFor="dateOfBirth" className="form-label">dateOfBirth</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="dateOfBirth"
                        value={dateOfBirth}
                        onChange={dateOfBirthhandler}
                        ></input>
                    </div> */}
                            {/* <div className="mb-3">
                        <label htmlFor="address" className="form-label">address</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="address"
                        value={address}
                        onChange={addresshandler}
                        ></input>
                    </div> */}
                            {/* <div className="mb-3">
                        <label htmlFor="city" className="form-label">city</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="city"
                        value={city}
                        onChange={cityhandler}
                        ></input>
                    </div> */}
                            {/* <div className="mb-3">
                        <label htmlFor="state" className="form-label">state</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="state"
                        value={state}
                        onChange={statehandler}
                        ></input>
                    </div> */}
                            {/* <div className="mb-3">
                        <label htmlFor="pinCode" className="form-label">pinCode</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="pinCode"
                        value={pinCode}
                        onChange={pinCodehandler}
                        ></input>
                        
                    </div> */}
                            {/* <div className="mb-3">
                        <label htmlFor="country" className="form-label">country</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="country"
                        value={country}
                        onChange={countryhandler}
                        ></input>
                    </div> */}
                            {/* <Button className="btn btn-outline-info mx-2">Submit</Button> */}
                            {/* <button className="btn btn-outline-info mx-2">Submit</button> */}
                            <button type="button" class="btn btn-outline-info">Submit</button>
                            {/* <Link to="/"type="submit" className="btn btn-success">Submit</Link> */}
                            <Link to="/Addemployee" type="submit" className="btn btn-outline-danger mx-2">Cancel</Link>
                        </form>
                    </div>

                </div>
            </div>
        </div>
    
    );

}
export default Employeeform;
